import React from 'react'
import ReactEcharts from 'echarts-for-react'

class BarChartJournal extends React.Component {
    xAxisData = [];
    data1 = [10,20];
    data2 = [1,29];
    data3 = [4,50];
    data4 = [2,100];


    getOption = () => ({
        legend: {
            data: ['bar', 'bar2'],
            left: '10%'
          },
          brush: {
            toolbox: ['rect', 'polygon', 'lineX', 'lineY', 'keep', 'clear'],
            xAxisIndex: 0
          },
          toolbox: {
            feature: {
              magicType: {
                type: ['stack']
              },
              dataView: {}
            }
          },
          tooltip: {},
          xAxis: {
            data: xAxisData,
            name: 'X Axis',
            axisLine: { onZero: true },
            splitLine: { show: false },
            splitArea: { show: false }
          },
          yAxis: {},
          grid: {
            bottom: 100
          },
          series: [
            {
              name: 'bar',
              type: 'bar',
              stack: 'one',
              emphasis: emphasisStyle,
              data: data1
            },
            {
              name: 'bar2',
              type: 'bar',
              stack: 'one',
              emphasis: emphasisStyle,
              data: data2
            },

          ]
      });

      render(){
        return (
            <ReactEcharts
                option={this.getOption()}
                style={{ height: "700px", width: "800px", marginLeft:"50px", marginTop:"30px"}}
            />
        );
      }




}

export default BarChartJournal
